// data driven preferences
var preferences = [{
  id: "chefschoice"
}, {
  id: "veggie"
}, {
  id: "family"
}, {
  id: "lowcalorie"
}];
var planPage = new _PlanPage["default"]();
planPage.visitAU(); // assert that the plan widget exists in the DOM and is visible
planPage.getPlans().should('exist');
planPage.getPlans().should('be.visible'); // click through each preference on the page
cy.wrap(preferences).each(function (preference) {
  // assert that each preference exists in the DOM and is visible
  // before clicking on it
  planPage.selectYourPreference(preference.id).should('exist');
  planPage.selectYourPreference(preference.id).should('be.visible');
  planPage.selectYourPreference(preference.id).click(); // clicks through all Number of People options
  planPage.selectAllPeople(); // clicks through all Recipes per Week options
  planPage.selectAllRecipes(); // check that Price Per Serving is not empty
  // and log the price
  planPage.getPrice().should('not.be.empty');
  planPage.getPrice().then(function ($price) {
    cy.log($price.text());
  }); // check that Shipping cost is not empty
  // and log the shipping cost
  planPage.getShippingCost().should('not.be.empty');
  planPage.getShippingCost().then(function ($shipping) {
    cy.log($shipping.text());
  });
});

